import { EXAMPLE_MSG, EXAMPLE_OBJ } from "../actions/types";

const initialState = {
  expMsg: "",
  expObj: {
    friends: [],
  },
};

export default function (state = initialState, action) {
  const { type, payload } = action;

  switch (type) {
    case EXAMPLE_MSG:
      return {
        ...state,
        expMsg: payload,
      };

    case EXAMPLE_OBJ:
      return {
        ...state,
        expObj: payload,
      };
    default:
      return state;
  }
}
